import React from 'react';
import { Link } from 'react-router-dom'; // Ensure Link is correctly imported
import Layout from '../../common/Layout'; // Ensure Layout is correctly imported
import { PageBanner, Counter, AboutComp, Features, Team, Review } from '../layouts/about/index'; // Ensure these components are correctly exported and imported
import Abi from '../layouts/about/Abi';

const AboutMain = () => {
    return (
        <div className="about">
            <Layout>
                <Abi />
                <PageBanner
                    title="About us"
                    rootUrl="/"
                    parentUrl="Home"
                    currentUrl="About"
                />
                <Features />
                <Team />
                <Counter />
                <AboutComp />
                <Review />
                <Link to="/course-list" className="btn btn-grey btn-sm rounded">
                    Join Now <i className="fal fa-angle-right"></i>
                </Link>
            </Layout>
        </div>
    );
}

export default AboutMain;
